          <li className="column">
            <State
              {...{
                customerInputs,
                setPADDRegion,
                inStep: true,
                whichStep,
              }}
            />
          </li>
        </ul>
      </div>
      <Buttons {...{ whichStep, setWhichStep }} />
      <Inputs
        {...{
          setPADDRegion,
          customerInputs,
          setCustomerInputs,
          whichStep,
          setWhichStep,
        }}
      />
    </div>
  );
};

export default Step1;
